import React, { Component } from "react";
import { Link } from "react-router-dom";
import { ReactComponent as Healthlogo } from "../../healthcare.svg";
import { ReactComponent as SearchIcon } from "../../search-solid.svg";

import styled from "styled-components";
import { ButtonContainer } from "../../Button";

export class Navbar extends Component {
  render() {
    return (
      <NavWrapper className="navbar navbar-expand-sm bg-light">
        <Link
          to="/"
          className="navbar-brand"
          style={{ color: "black", textDecoration: "None" }}
        >
          <Healthlogo width="40px" height="35px" />
          CoronaTrace
        </Link>

        <form className="form-inline my-2 my-lg-0">
          {" "}
          <SearchIcon width="20px" height="20px"></SearchIcon>
          <input
            className="form-control mr-sm-2"
            type="search"
            placeholder="Search Location"
            aria-label="searh"
            name="q"
          ></input>
          <button className="btn  my-2 my-md-6" type="submit">
            Search
          </button>
        </form>
        <span>
          <Link to="/login ml-auto">
            <ButtonContainer>Log In</ButtonContainer>
          </Link>

          <Link to="/signin">
            <ButtonContainer primary>Sign In</ButtonContainer>
          </Link>
        </span>
      </NavWrapper>
    );
  }
}

const NavWrapper = styled.nav`
  background: white;
  font-size: 2.5rem;
  display: flex;
  justify-content: space-between;
`;
export default Navbar;
